import React from "react";
import { useParams } from "react-router-dom";

const ViewUser = () => {
  const { userid } = useParams();
  return (
    <div>
      <div className="viewcontainer">
        <h1>User Details</h1>
      </div>
    </div>
  );
};

export default ViewUser;
